function Coloumnfilter({column}) {
    const {filterVaue,setFilter}=column
    return (
        <span>
            Search: {' '}
            <input
            value={filterVaue||''}
            onChange={(e)=>setFilter(e.target.value)}/>
        </span>
    )
}

